data:
  definition: conventionally the product stem:[V] · stem:[I] · stem:[f], expressed
    in watts or kilowatts, where stem:[V] is the peak value of the high-voltage output,
    stem:[I] is the average value of the output current and stem:[f] is a coefficient
    depending on the waveform of the current and the voltage
  examples: []
  notes: []
